import React, { useState, useEffect } from 'react';
import _Redux from '../Store/_Redux';

const FetchAllGenresOfMovies = props => {

    return (
        <React.Fragment>
            {/* FETCH_WAR_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=10752' />

            {/* FETCH_HORROW_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=9648' />

            {/* FETCH_WESTERN_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=10770' />

            {/* FETCH_WESTERN_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=9648' />

        </React.Fragment>
    )
}

export default FetchAllGenresOfMovies;
